import React from "react";
import styles from "./ContainerCard.module.scss";
import Link from "next/link";

export function ContainerCard(container) {
  console.log(container);
  return (
    <div className={styles.container}>
      <div className={styles.info}>
        <h1>Container 13,8 kvm2</h1>
      </div>
      <Link href="/container/location">
        <button className={styles.button}>Boka förråd</button>
      </Link>

      <div className={styles.info}></div>

      <div className={styles.PriceWrapper}>
        <h1 className={styles.h1}>800kr</h1>
        <h3 className={styles.h3}>/månad</h3>
      </div>
    </div>
  );
}
